CREATE TRIGGER `update_analysis` AFTER UPDATE ON `hosts_status`
 FOR EACH ROW BEGIN
  host_name,
  cpu_max,
  cpu_max_timestamp,
  cpu_min,
  cpu_min_timestamp,
  memory_max,
  memory_max_timestamp,
  memory_min,
